// Get all unique makes
export function getAllMakes(): string[] {
  const makes = new Set<string>();
  vehicleDatabase.forEach((v) => makes.add(v.make));
  return Array.from(makes).sort();
}

// Get unique models for a make
export function getModelsForMake(make: string): string[] {
  const models = new Set<string>();
  vehicleDatabase.filter((v) => v.make === make).forEach((v) => models.add(v.model));
  return Array.from(models).sort();
}

// Get year/trim combos for a make+model
export function getVariantsForModel(make: string, model: string): VehicleEntry[] {
  return vehicleDatabase
    .filter((v) => v.make === make && v.model === model)
    .sort((a, b) => b.year - a.year);
}

// Get a specific vehicle
export function getVehicle(make: string, model: string, year: number, trim: string): VehicleEntry | undefined {
  return vehicleDatabase.find(
    (v) => v.make === make && v.model === model && v.year === year && v.trim === trim
  );
}

